import React from "react";

import Directory from "../../components/directory/directory.component";

import "./homepage.styles.scss";

const HomePage = () => (
  <div className="homepage">
    <div
      style={{
        display: "flex",
        justifyContent: "flexEnd"
      }}
    >
      <h1>Vastra</h1>
    </div>
    <Directory />
  </div>
);

export default HomePage;
